import React from 'react';
import { useState, useCallback } from 'react';
import { handleDragOver, handleDrop, handleFileChange } from './scripted.js';

import './registration.css'; // Make sure this is the correct path to your CSS file

const Registration = () => {
  const [username, setUsername] = useState('');
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [idNumber, setIdNumber] = useState('');
  const [degree, setDegree] = useState('');
  const [aboutYou, setAboutYou] = useState('');
  const [email, setEmail] = useState('');
  const [selectedFile, setSelectedFile] = useState(null);
  const [uploadMessage, setUploadMessage] = useState('Upload Profile Pic');

  const onFileChange = useCallback(handleFileChange(setSelectedFile, setUploadMessage), []);
  const onDrop = useCallback(handleDrop(onFileChange), [onFileChange]);

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log("Form submitted:", { username, firstName, lastName, password, confirmPassword, idNumber, degree, aboutYou, email });
  };

  return (
    <div className="registration__container-body">
      <div className="taft-overflow-welcome">Welcome to</div>
      <div className="taft-overflow-title">Taft Overflow</div>
      <div className="taft-overflow-content">
        <form onSubmit={handleSubmit}>
          <div className="taft-overflow-user-details">
            <div className="taft-overflow-input-box">
              <input type="text" placeholder="Username" required value={username} onChange={e => setUsername(e.target.value)} />
            </div>
            <div className="taft-overflow-split-input">
              <div className="taft-overflow-input-box taft-overflow-split-input1">
                <input type="text" className="taft-overflow-input" placeholder="First Name" required value={firstName} onChange={e => setFirstName(e.target.value)} />
              </div>
              <div className="taft-overflow-input-box taft-overflow-split-input2">
                <input type="text" placeholder="Last Name" required value={lastName} onChange={e => setLastName(e.target.value)} />
              </div>
            </div>
            <div className="taft-overflow-input-box">
              <input type="password" placeholder="Password" required value={password} onChange={e => setPassword(e.target.value)} />
            </div>
            <div className="taft-overflow-split-input">
              <div className="taft-overflow-input-box taft-overflow-split-input1">
                <input type="text" className="taft-overflow-input" placeholder="ID Number" required value={idNumber} onChange={e => setIdNumber(e.target.value)} />
              </div>
              <div className="taft-overflow-input-box taft-overflow-split-input2">
                <input type="text" placeholder="Degree" required value={degree} onChange={e => setDegree(e.target.value)} />
              </div>
            </div>
            <div className="taft-overflow-input-box">
              <input type="password" placeholder="Confirm Password" required value={confirmPassword} onChange={e => setConfirmPassword(e.target.value)} />
            </div>
            <div className="taft-overflow-input-box">
              <input type="text" placeholder="About You" required value={aboutYou} onChange={e => setAboutYou(e.target.value)} />
            </div>
            <div className="taft-overflow-input-box">
              <input type="email" placeholder="DLSU Email" required value={email} onChange={e => setEmail(e.target.value)} />
            </div>
            <div className="taft-overflow-input-box taft-overflow-upload-area"
                 onDragOver={handleDragOver}
                 onDrop={onDrop}>
              <label htmlFor="profilePicInput" className={selectedFile ? 'upload-area uploaded' : 'upload-area'}>
                <p>{uploadMessage}</p>
                <input type="file" id="profilePicInput" accept=".png, .jpg, .jpeg" hidden onChange={(e) => onFileChange(e.target.files[0])} />
              </label>
            </div>
            <div className="taft-overflow-register-button">
              <input type="submit" value="Register" className="taft-overflow-submit-button" />
              <div className="login">Already registered? <span>Log in</span></div>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
}

export default Registration;
